prompt --application/shared_components/plugins/region_type/com_apexhierarchychart_plugin
begin
wwv_flow_imp_shared.create_plugin(
 p_id=>wwv_flow_imp.id(205145835849788167298)
,p_plugin_type=>'REGION TYPE'
,p_name=>'COM.APEXHIERARCHYCHART.PLUGIN'
,p_display_name=>'Hierarchy Chart'
,p_plsql_code=>wwv_flow_string.join(wwv_flow_t_varchar2(
'-- =============================================================================',
'--',
'--  Created by Richard Baldogi',
'--',
'--  This plug-in helps to visualize data in a hierarchical view.',
'--',
'--  License: MIT',
'--',
'--  GitHub: https://github.com/baldogiRichard/apex-hierarchy-chart',
'--',
'-- =============================================================================',
'',
'--This procedure was created to split strings that''s length is over 32K',
'procedure splitJSON(p_json in clob,',
'                    p_varname in varchar2,',
'                    p_splitter in number)',
'is',
'    l_chunks_cnt number;',
'    l_from number := 1;',
'begin',
'    l_chunks_cnt := ceil(length(p_json) / p_splitter);',
'    apex_javascript.add_inline_code (p_code => ''var '' || p_varname || '' = "";'');',
'    for i in 1..l_chunks_cnt loop',
'        apex_javascript.add_inline_code (p_code => p_varname || '' += "'' || ',
'                                                   apex_escape.json(p_string => substr(p_json,l_from,p_splitter))',
'                                                   || ''";'');    ',
'        l_from := (i * p_splitter) + 1;',
'    end loop;',
'end splitJSON;',
'',
'--get node template column positions and gather them into one common array',
'function get_col_positions( p_columns in varchar2',
'                          , p_context in apex_exec.t_context)',
'return apex_t_varchar2',
'is',
'    l_col_pos pls_integer;',
'    l_table apex_t_varchar2;',
'',
'    l_cols apex_application_global.vc_arr2 := apex_string.string_to_table( p_str => p_columns',
'                                                                         , p_sep => '','');',
'begin',
'    ',
'    for i in 1..l_cols.count loop',
'        l_col_pos := apex_exec.get_column_position(p_context, l_cols(i));',
'        apex_string.push( p_table => l_table',
'                        , p_value => l_cols(i) || '':'' || l_col_pos);',
'    end loop;',
'',
'    return l_table;',
'end;',
'',
'--get hierarchy data',
'function get_hierarchy_data',
'   (  p_region_data        in apex_plugin.t_region',
'   ,  p_filter             in apex_t_varchar2 default null',
'   )',
'return clob',
'is',
'    --region and ajax id',
'    l_region_static_id      p_region_data.static_id%type    := p_region_data.static_id;',
'    l_region_id             p_region_data.id%type           := p_region_data.id;',
'',
'    --region source',
'    l_context               apex_exec.t_context;',
'',
'    --attributes',
'    l_id_col                p_region_data.attribute_01%type   := p_region_data.attributes.get_varchar2(''id_column'');',
'    l_parent_id_col         p_region_data.attribute_02%type   := p_region_data.attributes.get_varchar2(''parent_id_column'');',
'    l_node_template_cols    p_region_data.attribute_03%type   := p_region_data.attributes.get_varchar2(''node_template_column'');',
'    l_partial_load          p_region_data.attribute_06%type   := p_region_data.attributes.get_varchar2(''partial_data_load'');',
'    l_node_level_cols       p_region_data.attribute_07%type   := p_region_data.attributes.get_varchar2(''node_level_column'');',
'    l_initial_expand_lvl    p_region_data.attribute_08%type   := to_number(p_region_data.attributes.get_varchar2(''last_node_level_to_be_expanded'')) + 1;',
'',
'    --query variables',
'    l_id_col_pos                        pls_integer;',
'    l_parent_id_col_pos                 pls_integer;',
'    l_node_level_col_pos                pls_integer;',
'',
'    --hierarchy variables',
'    l_id_col_val                        varchar2(32767);',
'    l_parent_id_col_val                 varchar2(32767);',
'    l_node_template_cols_val            varchar2(32767);',
'',
'    --JSON output variable',
'    l_json_text                         clob;',
'',
'    --region source',
'    l_region_record         apex_application_page_regions%rowtype;',
'    l_ids_arr               apex_t_varchar2;',
'    l_filters               apex_exec.t_filters;',
'',
'    --other variables',
'    l_node_cols_arr     apex_t_varchar2;',
'    l_node_level_arr    apex_t_varchar2;',
'    l_custom_col        apex_t_varchar2;',
'',
'begin',
'',
'    --get region data',
'    select aapr.*',
'    into l_region_record',
'    from apex_application_page_regions aapr',
'    where aapr.region_id = l_region_id;',
'',
'    --converting region source into a JSON structure',
'    if l_region_record.location is not null then',
'      ',
'        --It''s value can come from the AJAX request if Partial Load is enabled',
'        if p_filter is not null then',
'',
'            apex_exec.add_filter(',
'                p_filters     => l_filters,',
'                p_filter_type => apex_exec.c_filter_in,',
'                p_column_name => l_parent_id_col,',
'                p_values      => p_filter',
'            );            ',
'',
'        end if;',
'',
'        --If Partial Load is enabled then only fetch the root and it''s descendants',
'        if l_partial_load = ''Y'' and p_filter is null then',
'',
'            for i in 1..l_initial_expand_lvl loop',
'',
'                apex_string.push( p_table => l_node_level_arr',
'                                , p_value => i);',
'',
'            end loop;',
'',
'            apex_exec.add_filter(',
'                p_filters     => l_filters,',
'                p_filter_type => apex_exec.c_filter_in,',
'                p_column_name => l_node_level_cols,',
'                p_values      => l_node_level_arr',
'            );            ',
'',
'        end if;',
'',
'        l_context := apex_exec.open_query_context(',
'              p_location                => l_region_record.location_code',
'            --',
'            , p_table_owner             => l_region_record.table_owner',
'            , p_table_name              => l_region_record.table_name',
'            , p_where_clause            => l_region_record.where_clause',
'            , p_order_by_clause         => l_region_record.order_by_clause',
'            , p_include_rowid_column    => case l_region_record.include_rowid_column',
'                                                when ''Yes'' then TRUE',
'                                                when ''No''  then FALSE',
'                                           end',
'            --          ',
'            , p_sql_query               => case when l_region_record.function_body_language is null',
'                                                  then l_region_record.region_source',
'                                                else null ',
'                                           end',
'            , p_plsql_function_body     => case when nvl(l_region_record.function_body_language,'''') = ''PLSQL''',
'                                                  then l_region_record.region_source',
'                                                else null ',
'                                           end',
'            , p_optimizer_hint          => l_region_record.optimizer_hint',
'            --',
'            , p_server_static_id        => l_region_record.remote_database_name',
'            --',
'            , p_module_static_id        => l_region_record.web_source_module_name',
'            , p_external_filter_expr    => l_region_record.external_filter_expr',
'            , p_external_order_by_expr  => l_region_record.external_order_by_expr',
'            , p_filters                 => l_filters',
'            );',
'',
'        --Get ID and Parent ID columns position        ',
'        l_id_col_pos                        := apex_exec.get_column_position(l_context, l_id_col);',
'        l_parent_id_col_pos                 := apex_exec.get_column_position(l_context, l_parent_id_col);        ',
'',
'        --Loop through Node Template columns',
'        l_node_cols_arr := get_col_positions( p_columns => l_node_template_cols',
'                                            , p_context => l_context);',
'',
'        --creating JSON for JS initialization',
'        apex_json.initialize_clob_output;',
'',
'            apex_json.open_array;',
'',
'                while apex_exec.next_row(l_context) ',
'                loop',
'',
'                    apex_json.open_object;',
'',
'                        --ID and Parent ID columns',
'                        l_id_col_val        := apex_exec.get_varchar2(l_context, l_id_col_pos);',
'                        l_parent_id_col_val := apex_exec.get_varchar2(l_context, l_parent_id_col_pos);',
'',
'                        apex_json.write( p_name  => ''id''',
'                                       , p_value => l_id_col_val);',
'',
'                        apex_json.write( p_name         => ''parentId''',
'                                       , p_value        => coalesce(l_parent_id_col_val,null)',
'                                       , p_write_null   => true);',
'',
'                        --Custom Columns',
'                        for i in 1..l_node_cols_arr.count',
'                        loop',
'',
'                            l_custom_col := apex_string.split( p_str => l_node_cols_arr(i)',
'                                                             , p_sep => '':'');',
'',
'                            l_node_template_cols_val := apex_exec.get_varchar2(l_context, to_number(l_custom_col(2)));',
'',
'                            apex_json.write( p_name  => l_custom_col(1)',
'                                           , p_value => l_node_template_cols_val);',
'                        end loop;',
'',
'                    apex_json.close_object;',
'',
'                end loop;',
'',
'            apex_json.close_array;',
'',
'        l_json_text := apex_json.get_clob_output;',
'',
'        apex_json.free_output;',
'',
'    end if;',
'',
'    return l_json_text;',
'',
'end get_hierarchy_data;',
'',
'--get hierarchy data',
'function get_config_data',
'   (  p_region_config      in apex_plugin.t_region )',
'return clob',
'is',
'',
'    --ajax id',
'    l_ajax_id               p_region_config.static_id%type    := apex_plugin.get_ajax_identifier;',
'',
'    --region id',
'    l_region_static_id      p_region_config.static_id%type    := p_region_config.static_id;',
'    l_region_id             p_region_config.id%type           := p_region_config.id;',
'',
'    --attributes',
'    l_node_template         p_region_config.attribute_04%type := p_region_config.attributes.get_varchar2(''node_template'');',
'    l_node_button_template  p_region_config.attribute_05%type := p_region_config.attributes.get_varchar2(''node_button_template'');',
'    l_partial_load          p_region_config.attribute_06%type := p_region_config.attributes.get_varchar2(''partial_data_load'');',
'    l_initial_expand_lvl    p_region_config.attribute_08%type := to_number(p_region_config.attributes.get_varchar2(''last_node_level_to_be_expanded'')) - 1;',
'    l_node_width            p_region_config.attribute_09%type := to_number(p_region_config.attributes.get_varchar2(''node_width''));',
'    l_node_height           p_region_config.attribute_10%type := to_number(p_region_config.attributes.get_varchar2(''node_height''));',
'',
'    --JSON output',
'    l_config_json clob;',
'',
'begin',
'',
'    apex_json.initialize_clob_output;',
'',
'        apex_json.open_object;',
'',
'            apex_json.write( p_name  => ''regionId''',
'                           , p_value => coalesce(l_region_static_id, ''R'' || l_region_id));',
'',
'            apex_json.write( p_name  => ''nodeTemplate''',
'                           , p_value => l_node_template);',
'',
'            apex_json.write( p_name  => ''nodeButtonTemplate''',
'                           , p_value => l_node_button_template);',
'',
'            apex_json.write( p_name  => ''nodeWidth''',
'                           , p_value => l_node_width);',
'',
'            apex_json.write( p_name  => ''nodeHeight''',
'                           , p_value => l_node_height);',
'',
'            apex_json.write( p_name  => ''partialLoad''',
'                           , p_value => l_partial_load);',
'',
'            apex_json.write( p_name  => ''ajaxIdentifier''',
'                           , p_value => l_ajax_id);                           ',
'',
'            apex_json.write( p_name  => ''initialExpandLevel''',
'                           , p_value => l_initial_expand_lvl);',
'',
'        apex_json.close_object;',
'',
'        l_config_json := apex_json.get_clob_output;',
'',
'    apex_json.free_output;',
'',
'    return l_config_json;',
'',
'end get_config_data;',
'',
'--render',
'procedure render (',
'    p_plugin in            apex_plugin.t_plugin,',
'    p_region in            apex_plugin.t_region,',
'    p_param  in            apex_plugin.t_region_render_param,',
'    p_result in out nocopy apex_plugin.t_region_render_result )',
'as',
'    --init js',
'    l_init_js               varchar2(32767)         := nvl(apex_plugin_util.replace_substitutions(p_region.init_javascript_code), ''undefined'');',
'',
'    --other variables',
'    l_json_text             clob := ''{}'';',
'    l_js_varname            constant varchar2(10)   := sys.dbms_random.string(''a'',10);',
'',
'    --JSON variables',
'    l_json_data             clob;',
'    l_json_config           clob;',
'',
'begin',
'',
'    --debug',
'    if apex_application.g_debug',
'    then',
'        apex_plugin_util.debug_region',
'          ( p_plugin => p_plugin',
'          , p_region => p_region',
'          );',
'    end if;',
'',
'    --create hierarchy JSON',
'    l_json_data := get_hierarchy_data( p_region_data => p_region);',
'',
'    --create config JSON',
'    l_json_config := get_config_data( p_region_config => p_region);',
'',
'    --split JSON',
'    splitJSON( p_json     => l_json_data',
'             , p_varname  => l_js_varname',
'             , p_splitter => 5000);',
'',
'    -- Adding librarires manually due to a reference error which is caused by charset="utf-8" attribute is not set in the script tag.',
'    -- Source: https://stackoverflow.com/questions/21381097/d3-is-not-defined-referenceerror',
'    apex_javascript.add_library( p_name         => ''d3.v7''',
'                               , p_directory    => p_plugin.file_prefix || ''js/''',
'                               , p_attributes   => ''charset="utf-8"'');',
'',
'    apex_javascript.add_library( p_name         => ''d3-org-chart@3''',
'                               , p_directory    => p_plugin.file_prefix || ''js/''',
'                               , p_attributes   => ''charset="utf-8"'');',
'',
'    apex_javascript.add_library( p_name         => ''d3-flextree''',
'                               , p_directory    => p_plugin.file_prefix || ''js/''',
'                               , p_attributes   => ''charset="utf-8"'');',
'',
'    apex_javascript.add_library( p_name         => ''script''',
'                               , p_directory    => p_plugin.file_prefix || ''js/''',
'                               , p_attributes   => ''charset="utf-8"'');                                                              ',
'',
'    --Add onload code',
'    apex_javascript.add_onload_code(p_code => ''HIERARCHYCHART.initialize('' || l_json_config || '','' || l_js_varname || '','' || l_init_js || '');'');',
'',
'end render;',
'',
'-- AJAX function which is used to return the rest of the hierarchy for the chart',
'procedure ajax (',
'    p_region in            apex_plugin.t_region,',
'    p_plugin in            apex_plugin.t_plugin,',
'    p_param  in            apex_plugin.t_region_ajax_param,',
'    p_result in out nocopy apex_plugin.t_region_ajax_result )',
'as',
'',
'    --ajax values',
'    l_parent_ids     varchar2(32000) := apex_application.g_x01;',
'',
'    --error handling',
'    l_apex_error     apex_error.t_error;',
'',
'    --JSON parse and construct variables',
'    l_values         apex_json.t_values;',
'    l_value          varchar2(1000);',
'    l_count          number;',
'    l_node_ids       apex_t_varchar2;',
'    l_json           clob;',
'',
'begin',
'',
'    --debug',
'    if apex_application.g_debug ',
'    then',
'        apex_plugin_util.debug_region',
'          ( p_plugin => p_plugin',
'          , p_region => p_region',
'          );',
'    end if;',
'',
'    --parse JSON',
'    apex_json.parse ( p_values => l_values',
'                    , p_source => l_parent_ids);',
'',
'    --get new nodes',
'    l_count := apex_json.get_count( p_path      => ''parentNodes''',
'                                  , p_values    => l_values);',
'',
'    for i in 1..l_count loop',
'',
'        l_value := apex_json.get_varchar2( p_path      => ''parentNodes[%d]''',
'                                         , p0          => i',
'                                         , p_values    => l_values);',
'',
'        apex_string.push( p_table => l_node_ids',
'                        , p_value => l_value);',
'',
'    end loop;',
'',
'    l_json := get_hierarchy_data( p_region_data => p_region',
'                                , p_filter      => l_node_ids);',
'',
'    --constructing response JSON',
'    apex_json.initialize_output;',
'',
'    apex_json.open_object;',
'',
'        apex_json.write( p_name     => ''newNodes''',
'                       , p_value    => l_json);',
'',
'    apex_json.close_object;',
'                       ',
'exception',
'    when others then',
'      apex_json.initialize_output;',
'',
'      l_apex_error.message             := sqlerrm;',
'      l_apex_error.ora_sqlcode         := sqlcode;',
'',
'      apex_json.open_object;      ',
'          apex_json.write(''status''          , ''error''             );',
'          apex_json.write(''message''         , l_apex_error.ora_sqlcode || '': '' || ',
'                                              l_apex_error.message);                                         ',
'      apex_json.close_object;',
'',
'end ajax;'))
,p_api_version=>3
,p_render_function=>'render'
,p_ajax_function=>'ajax'
,p_standard_attributes=>'SOURCE_LOCATION:AJAX_ITEMS_TO_SUBMIT:ORDER_BY:ESCAPE_OUTPUT:INIT_JAVASCRIPT_CODE:COLUMNS:HEADING_ALIGNMENT:VALUE_ALIGNMENT:VALUE_CSS:VALUE_ATTRIBUTE'
,p_substitute_attributes=>true
,p_version_scn=>15598805698318
,p_subscribe_plugin_settings=>true
,p_version_identifier=>'1.0'
,p_about_url=>'https://github.com/baldogiRichard/apex-hierarchy-chart'
,p_files_version=>822
,p_updated_on=>wwv_flow_imp.dz('20250111194916Z')
,p_updated_by=>'BALDOGI.RICHARD'
);
